CREATE PROCEDURE [rodeo].[GetHistoricAlarms]
	-- Add the parameters for the stored procedure here
	@Description varchar(200) = null,
	@PlcId int = null,
	@Address varchar(50) = null,
	@Alarm varchar(200) = null,
	@BeginDate datetimeoffset(7),
	@EndDate datetimeoffset(7),
	@IsShowingRecognized bit = null,
	@isShowOff bit = null,
	@IsShowQuarantine bit = null,
	@IsShowCancelation bit = null,
	@Group varchar(100) = null,
	@Island varchar(100)
AS

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
IF CHARINDEX('%', @Tag) <= 0 BEGIN SET @Tag = '%' + @Tag + '%' END
SELECT TagName ,SetPoint ,SentValue ,PreviousValue ,SentTime ,AnswerTime ,AnswerCode ,UserName ,AppName ,LocName FROM [rodeo].[Rodeo_Commands_History] HC WHERE HC.[SentTime] BETWEEN @BeginDate AND @EndDate AND (@Tag IS NULL OR HC.[TagName] LIKE @Tag) AND (@UserName IS NULL OR HC.[UserName] LIKE @UserName) AND (@AppName IS NULL OR HC.[AppName] LIKE @AppName) AND (@LocName IS NULL OR HC.[LocName] LIKE @LocName) ORDER BY HC.[SentTime] DESC END

